import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Left extends Component {
  render() {
    return (
      <div>
        <ul>
          <li>
            {/* <Link to="/home">Home</Link> */}  
          </li>
          <li>
            {/* <Link to="/about">About</Link> */}
          </li>
        </ul>
      </div>
    );
  }
}
